import React, {useState} from 'react';
import PostItem from './components/PostItem';
import './styles/App.css';

function App() {

  return (
    <div className="App">
      < PostItem post={{id: 1, title: 'JavaScript', body: 'Description', button: 'Удалить'}} />
      < PostItem post={{id: 2, title: 'Python', body: 'Second Description'}} />
      < PostItem post={{id: 3, title: 'C++', body: 'Third Description'}} />
    </div>
  );
}

export default App;
